import React, { Component } from 'react';

import GlobalStyle from '../../../styles/global';
import { Container, Content } from './styles.js';

import Upload from '../../../components/Upload';


class addKid extends Component {
  render() {
    return (
      <Container>
        <Content>
          <Upload />
        </Content>
        <GlobalStyle />
      </Container>
    )
  }
}

export default addKid;
